import React from 'react'

interface PostProps {
  caption: string,
  content: string,
  userId: string

}
const Post = ({caption, content, userId}: PostProps) => {
  return (
    <div>
      
      <img src={content} />

      <h1>
      
      {userId}: {caption}
      </h1>
      
      </div>
  )
}

export default Post
